import React from 'react';
import { CardColumns } from 'react-bootstrap';

///will be responsible for rendering a list of dinosaurs
// const ErasList = (props) => {
const ErasList = (props) => {

  return (
<div>
  <center>
    <CardColumns>
      <div>
        {props.listEras}
      </div>
    </CardColumns>
    </center>
</div>

  )

}


export default ErasList
